import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';

import Stack from '@mui/material/Stack';

import Card from '../components/card';
import FormGroup from '../components/form-group';

import { mensagemSucesso, mensagemErro } from '../components/toastr';

import '../custom.css';

import axios from 'axios';
import { BASE_URL } from '../config/axios';

function CadastroCliente() {
  const { idParam } = useParams();

  const [produtos, setProdutos] = useState([]);
  const [selectedProduct, setSelectedProduct] = useState('');

  const navigate = useNavigate();

  const baseURL = `${BASE_URL}/pedidos`;

  const [id, setId] = useState('');
  const [IdCliente, setIdCliente] = useState('');
  const [pro, setListagemProdutos] = useState('');
  const [status, setStatus] = useState('');


  const [dados, setDados] = React.useState([]);

  function inicializar() {
    if (idParam == null) {
      setId('');
      setIdCliente('');
      setListagemProdutos('');
      setStatus('');
    } else {
      setId(dados.id);
      setIdCliente(dados.IdCliente);
      setListagemProdutos(dados.ListagemProdutos);
      setStatus(dados.status);
    }
  }

  async function salvar() {
    let data = { id, IdCliente, ListagemProdutos, status};
    data = JSON.stringify(data);
    if (idParam == null) {
      await axios
        .post(baseURL, data, {
          headers: { 'Content-Type': 'application/json' },
        })
        .then(function (response) {
          mensagemSucesso(`Pedido ${id} cadastrado com sucesso!`);
          navigate(`/listagem-pedidos`);
        })
        .catch(function (error) {
          mensagemErro(error.response.data);
        });
    } else {
      await axios
        .put(`${baseURL}/${idParam}`, data, {
          headers: { 'Content-Type': 'application/json' },
        })
        .then(function (response) {
          mensagemSucesso(`Pedido ${id} alterado com sucesso!`);
          navigate(`/listagem-pedidos`);
        })
        .catch(function (error) {
          mensagemErro(error.response.data);
        });
    }
  }

  async function buscar() {
    await axios.get(`${baseURL}/${idParam}`).then((response) => {
      setDados(response.data);
    });
    setId(dados.id);
    setIdCliente(dados.IdCliente);
    setListagemProdutos(dados.ListagemProdutos);
    setStatus(dados.status);
  }

  const [dadosPedidos, setDadosPedidos] = React.useState(null);

  useEffect(() => {
    axios.get(`${BASE_URL}/cursos`).then((response) => {
      setDadosPedidos(response.data);
    });
  }, []);

  useEffect(() => {
    buscar(); // eslint-disable-next-line
  }, [id]);

  if (!dados) return null;

  return (
    <div className='container'>
      <Card title='Cadastro de Pedido'>
        <div className='row'>
          <div className='col-lg-12'>
            <div className='bs-component'>
              <FormGroup label='Cliente: *' htmlFor='inputCliente'>
                <input
                  type='text'
                  id='inputCliente'
                  value={IdCliente}
                  className='form-control'
                  name='idCliente'
                  onChange={(e) => setNome(e.target.value)}
                />
              </FormGroup>
               <FormGroup>
                    <label htmlFor="selectProduto">Produto:</label>
                    <select
                        id="selectProduto"
                        value={selectedProduct}
                        onChange={handleProductChange}
                        className="form-control"
                    >
                        <option value="">Selecione um produto</option>
                        {produtos.map((produto) => (
                        <option key={produto.id} value={produto.id}>
                            {produto.nome}
                        </option>
                        ))}
                    </select>
                </FormGroup>
              <FormGroup label='Email: *' htmlFor='inputEmail'>
                <input
                  type='email'
                  id='inputEmail'
                  value={email}
                  className='form-control'
                  name='email'
                  onChange={(e) => setEmail(e.target.value)}
                />
              </FormGroup>
              <FormGroup label='Senha:' htmlFor='inputSenha'>
                <input
                  type='text'
                  id='inputSenha'
                  value={senha}
                  className='form-control'
                  name='senha'
                  onChange={(e) => setSenha(e.target.value)}
                />
              </FormGroup>
              <Stack spacing={1} padding={1} direction='row'>
                <button
                  onClick={salvar}
                  type='button'
                  className='btn btn-success'
                >
                  Salvar
                </button>
                <button
                  onClick={inicializar}
                  type='button'
                  className='btn btn-danger'
                >
                  Cancelar
                </button>
              </Stack>
            </div>
          </div>
        </div>
      </Card>
    </div>
  );
}

export default CadastroCliente;
